import React from 'react';
import ReactDom from 'react-dom';

var date = new Date();
ReactDom.render(
  <>
  <h1>my name is niraj singh</h1>
  <p>current date is {date.toLocaleDateString()}</p>
  <p>current time is {date.toLocaleTimeString()}</p>
  </>
  ,
  document.getElementById('root')
)
